{"linkedInId": "1550928", "name": "AmeriCorps St. Louis", "universalName": "americorps-st.-louis", "linkedInUrl": "https://www.linkedin.com/company/1550928", "employeeCount": 44, "followerCount": 731, "employeeCountRange": {"start": 11, "end": 50}, "websiteUrl": "http://www.americorpsstl.org", "tagline": "See The Need, Meet The Need ~ Celebrating 30 Years of Service", "description": "Since 1994, inspired people from across America have brought to St. Louis their enthusiasm, their talents and a commitment to serve their country. AmeriCorps St. Louis has distinguished itself as one of the leading AmeriCorps programs in the nation through a long and impressive history. Each year the program recruits nearly 40 Members to serve as part of our Emergency Response Team. In all, AmeriCorps St. Louis Members have committed more than three million hours of service – getting things done for St. Louis and the nation.

